import Vue from 'vue';
import App from './App.vue';

const { nonce } = wpApiSettings.nonce;

Vue.config.productionTip = false;
Vue.prototype.$nonce = nonce;

new Vue({
  render: (h) => h(App),
}).$mount('#app');
